import axios from "axios"

function CheckAdmin(){
    let id = sessionStorage.getItem("AdminId")
    
    axios.post('http://localhost:8989/api/admin/checkadmin',{id:id})
    .then((res)=>{
        console
        console.log(res.data)
        
    })
    .catch((err)=>{
        console.log(err)
    })


}
export default CheckAdmin
